import React from "react";
import { Link } from "react-router-dom";

function Genere() {
  return (
    <div>
      <ul className="nav genere-list">
        <li>
          <Link to="/home/movie/comedy">comedy</Link>
        </li>
        <li>horror</li>
        <li>romance</li>
      </ul>
    </div>
  );
}

export default Genere;
